\begin{abstract}
We explore zero-shot reasoning in Synthetic PolyRule Reasoning (SPR) by integrating neural networks with symbolic modules. Our goal is to generalize to unseen rules without further training. Although strong performance is observed on shape- and color-weighted accuracy metrics, we highlight a notable pitfall: a Rule Generalization Score remains at zero in our experiments, indicating serious difficulty in genuinely extrapolating to new rules. These results underscore the gap between promising partial indicators of success and genuinely robust zero-shot generalization.
\end{abstract}

\section{Introduction}
Modern deep learning methods have demonstrated strong performance in standard benchmarks, yet challenges in real-world or more general settings remain. Zero-shot reasoning is of particular interest because it aims for immediate out-of-distribution generalization, notably when rules or tasks change unexpectedly. Synthetic datasets allow controlled exploration of this capability but do not guarantee that methods will scale or generalize beyond toy domains. Nevertheless, insights from synthetic tasks can help expose pitfalls.

We consider the Synthetic PolyRule Reasoning (SPR) setup, where each sequence contains shape-color tokens, and labels depend on symbolic correction or composition rules. Inspired by prior breakthroughs in neural language models' zero-shot abilities \citep{Goodfellow2014, Krizhevsky2012}, we investigate a hybrid neural-symbolic approach that attempts to infer and apply new rules without retraining. Although shape- and color-weighted metrics suggest partial success, the zero-shot Rule Generalization Score (RGS) stays at zero. This negative result indicates that our system fails to handle genuinely novel symbolic configurations, highlighting a practical limitation for real-world deployment.

\section{Related Work}
Several studies have examined the limits of deep neural networks in generalization. \citet{Goodfellow2014} revealed vulnerabilities of high-capacity models and demonstrated that small adversarial perturbations can break performance. \citet{Krizhevsky2012} showed remarkable success scaling convolutions, but subsequent work sometimes exposes scenarios where deeper or larger models stall. \citet{He2016} broadened architectures through residual connections, yet zero-shot rule inference remains a subtle challenge. Although large language models can exhibit surprising performance on unseen prompts, combining symbolic manipulations with differentiable modules can still fail in more formal domains. Our approach probes these limitations directly in SPR tasks.

